import React from "react";

function ContactPage() {
  return (
    <center>
      <iframe
        style={{ overflow: "hidden" }}
        title="Contact"
        src="https://docs.google.com/forms/d/e/1FAIpQLScV1lBdUWjz12stzozHYYTdb7Kv3698odggzG9O3QlEDoTsEQ/viewform?embedded=true"
        width="640"
        height="911"
        frameborder="0"
        marginheight="0"
        marginwidth="0"
      >
        Contact
      </iframe>
    </center>
  );
}

export default ContactPage;
